import React from "react";
import "../css/players.css";
import "../css/propListMenu.css";
import "../css/player-prop-list.css";
import Draggable from "react-draggable";
import { PlayerPropsList } from "./playerPropsList";

export const SoccerPlayer = (props) => {


  return (
    <>
      <Draggable>
        <div className="player-container">
          <div className="soccerplayer-background"></div>
          <div className="menu">
            <ul className="in-menu">
              <li className="in-menu-item">
                Kaleci
              </li>
              <li className="in-menu-item">
                Libero Kaleci
              </li>
            </ul>            
          </div>
          <PlayerPropsList displayType={props.displayMode}/>
        </div>
      </Draggable>
    </>
  );
};
